import React from 'react';
import Home from './home';
import image from './img';
function App() {
  return (
    <div className="App">
      <Home />
      <img src='https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRLscBONNGOnrrl87chOQ-dRoKlTTSSpZLBZvfwL6p-LRzBmWUWlg0lPlkH4Vj4xZlaMRk&usqp=CAU'></img>
      <img src='https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTGoEfMCXMnJx84lGPdoPG4wxLNMgYo458KytjmRlL0z_BImuhdeG5oe51aarMTejKhmDw&usqp=CAU'></img>
      <image />
    </div>
  );
}

export default App;
